import React from 'react';

const InferText = ({inference}) => {
    if ({inference} === true) {
        return (
            <div className = "center">
                <h2> "This food is okay to eat!" </h2>

            </div>
        );
    }
    else{
        return (
            <div className = "center">
                <h2> "This food is NOT okay to eat!" </h2>

            </div>
        );
    }


}

export default InferText;
